import React from 'react';
import { Formik, Form, Field } from 'formik';

const LabeledField = ({ name, label, left, right, ...rest }) => (
        <div>
      <span htmlFor={name}>{label}</span>
      <Field
        id={name}
        name={name}
        {...rest}
      />
      </div>
  );

const Basic = () => (
  <div>
    <h1>Details</h1>
    <Formik
      onSubmit={(values, { setSubmitting }) => {
        setTimeout(() => {
          alert(JSON.stringify(values, null, 2));
          setSubmitting(false);
        }, 400);
      }}
    >
      {({ isSubmitting }) => (
        <Form>
          <LabeledField label="Firstname is " type="text" name="Firstname" />
          <LabeledField label="Lastname is " type="text" name="Lastname" />
          <button type="submit" disabled={isSubmitting}>
            Submit
          </button>
        </Form>
      )}
    </Formik>
  </div>
);

export default Basic;
